een goeie film

met Ryan Merriman, Andie MacDowell en Aidan Quinn

Februari 2006: de jonge Luke Abbate accepteert het aanbod van een vriend om mee te rijden naar de training van zijn team. De 
auto waarin Luke zit, raakt betrokken bij een ongeluk. Luke overlijdt na twee dagen in het ziekenhuis aan zijn 
hersenbeschadiging. Gedreven door deze tragedie trekt Jon Abbate, het vijftien jaar jongere broertje van Luke, zijn broers 
shirt met rugnummer 5 aan. Jon probeert nu de 'Wake Forest Demon Deacons' naar succes te leiden...
